/**
 * 
 */
var Melon = {
	
	/**
	 * 信息级别 
	 */
	info : "INFO",
	
	/**
	 * 成功级别 
	 */
	success : "SUCCESS",
	
	/**
	 * 警告级别
	 */
	warn : "WARN",

	/**
	 * 错误级别
	 */
	error : "ERROR",
	
	/**
	 * 判断操作是否成功 
	 */
	isSuccess : function(success) {
		if($.type(success) === "string") {
			return success.toUpperCase() === "SUCCESS";
		}
		return false;
	},
	
	/**
	 * 判断操作是否失败 
	 */
	isError : function(error) {
		if($.type(error) === "string") {
			return error.toUpperCase() === "ERROR";
		}
		return false;
	},
	
	/**
	 * 
	 */
	isInfo : function(info) {
		if($.type(info) === "string") {
			var upper = info.toUpperCase();
			return upper === "INFO" || upper === "INFORMATION"; 
		}
		return false;
	},
	
	/**
	 *  
	 */
	isWarn : function(warn) {
		if($.type(warn) === "string") {
			return warn.toUpperCase() === "WARN";
		}
		return false;
	},
	
	/**
	 * 对占位字符串进行格式化
	 * @param message
	 * @param value
	 * @returns
	 */
	format : function(message, value) {
    	var regex = /\{\d{1}\}/g,
    		values = null,
    		length = 0;
    	if($.isArray(value)) {
    		values = value;
    	} else {
    		values = [];
    		values.push(value);
    	}
    	length = values.length;
    	//
    	for(var i=0; i<length; i++) {
    		message = message.replace(regex, values[i]);
        }
    	return message;
    }
		
};
